package org.zywx.cooldev.util;

import javax.crypto.Cipher;
import javax.crypto.SecretKey;
import javax.crypto.spec.IvParameterSpec;
import javax.crypto.spec.SecretKeySpec;

import org.apache.commons.codec.binary.Hex;


public class DesSecureTool {

	/**
     * des-ede3-cbc 解密
     * @param str
     * @return
     * @throws Exception
     */
    public static byte[] decrypt_3des_cbc(String str) throws Exception{
    	char[] chr = str.toCharArray();
    	byte[] b = Hex.decodeHex(chr);
    	
    	byte[] key = "0123456789abcd0123456789".getBytes();
    	
    	IvParameterSpec iv = new IvParameterSpec("12345678".getBytes());
		SecretKey secretKey = new SecretKeySpec(key, "DESede");
		Cipher cipher = Cipher.getInstance("DESede/CBC/PKCS5Padding");
		cipher.init(Cipher.DECRYPT_MODE, secretKey, iv);
		
        byte[] decryptPlainText = cipher.doFinal(b);
//        String returnStr = new String(decryptPlainText);
        return decryptPlainText;
    }
    
    public static void main(String[] args) throws Exception {
		System.out.println(new String(decrypt_3des_cbc("")));
	}
}
